import logo from "./logo.svg";
import './components/ExpenseItem.css';

import "./App.css";
import ExpenseItem from "./components/ExpenseItem";
import { Card } from "./components/Card";

function App() {
  const expenses = [
    {
      title: "Car Insurance",
      amount: 294.36,
      date: new Date().toLocaleString().toString(),
    },
    {
      title: "Bike Insurance",
      amount: 485.36,
      date: new Date().toLocaleString().toString(),
    },
    {
      title: "Bus Insurance",
      amount: 2000.36,
      date: new Date().toLocaleString().toString(),
    }
  ];
  return (
    <Card>
      {expenses.map((prod) => {
        return <ExpenseItem prod={prod}/>;
      })}
    </Card>
  );
}

export default App;
